import React from 'react';
import {Link} from 'react-router-dom';

const data = [
    {
        label : 'HOME',
        to : '/'
    },

    {
        label : 'ABOUT',
        to : '/about'
    },

    {
        label : 'EXPERIENCE',
        to : '/experience'
    },

    {
        label : 'PROJECTS',
        to : '/projects'
    },

    {
        label : 'CONTACT',
        to : '/contact'
    },
]

const Navbar = () => {
    return (
        <div>
            <nav class="navbar">
                <div class="navbar-container">
                    <Link to>KY</Link>
                </div>
            </nav>
        </div>
    )
}

export default Navbar;
